        self.label_2.setText(_translate("Form",
                                        "<html><head/><body><p>K-Nearest Neighbors(KNN)</p><p><br/></p><p>The bars represent the parts\' similarity to the previously selected item/s. A shorter bar indicates higher similarity.</p><p><br/></p><p>A distance of 1.0 suggests no similarities were found between the selected item/s and the part. If all bars are 1.0, TF-IDF did not find a match and KNN was not used. Items with the highest ratings are recommended instead.</p><p><br/></p><p>An empty chart means that the current part window does not use KNN. The PCB and Switch windows do not use KNN.</p><p><br/></p><p>Only the top 50 are plotted. The labels are difficult to read after 50 items.</p><p><br/></p></body></html>"))
