        self.label_18.setText(_translate("Form",
                                         "<html><head/><body><p>Singular Value Decomposition(SVD)</p><p><br/></p><p>The bars represent the difference between the average original ratings and the average predicted ratings.</p><p><br/></p><p>The labeled bars show the difference between the two. Non-labeled bars are equal.</p><p><br/></p><p>An empty chart means that the current part window does not use SVD. Only the Switch and Keycap windows use SVD<br/></p><p>Only the top 50 are plotted. The labels are difficult to read after 50 items.</p></body></html>"))
